import React from 'react';
import './face.css'
const Face=({url,box})=>{
    return(
        <div style={{border:'2px solid black',display:'flex',justifyContent:'space-around'}}>
            <img id='image' className='br3' alt='' src={url} height='auto' />

        </div>
    );
}
export default Face;
